import { Search, User } from 'lucide-react';
import { Link } from 'react-router-dom';
import { Button } from './ui/button';
import { Input } from './ui/input';
import { useState, useEffect } from 'react';

export default function Navbar() {
  const [searchTerm, setSearchTerm] = useState('');
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [searchResults, setSearchResults] = useState<any[]>([]);
  const [allCars, setAllCars] = useState<any[]>([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    checkAuthStatus();
    fetchCars();
  }, []);

  const checkAuthStatus = () => {
    const token = localStorage.getItem('token');
    setIsAuthenticated(!!token);
  };

  const fetchCars = async () => {
    setLoading(true);
    try {
      const response = await fetch('http://localhost:5000/api/cars');
      const data = await response.json();
      setAllCars(data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = (e: React.ChangeEvent<HTMLInputElement>) => {
    const query = e.target.value;
    setSearchTerm(query);

    if (query.length > 2) {
      const filteredCars = allCars.filter((car) =>
        car.model.toLowerCase().includes(query.toLowerCase())
      );
      setSearchResults(filteredCars);
    } else {
      setSearchResults([]);
    }
  };

  return (
    <header className="bg-white shadow">
      <div className="container mx-auto px-4 py-6 flex items-center justify-between">
        <Link to="/" className="text-2xl font-bold">
          Car Rentals
        </Link>

        <nav className="space-x-4">
          <Link to="/" className="text-gray-600 hover:text-gray-900">Home</Link>
          <Link to="/cars" className="text-gray-600 hover:text-gray-900">Cars</Link>
          <Link to="/contact" className="text-gray-600 hover:text-gray-900">Contact Us</Link>
          <Link to="/about" className="text-gray-600 hover:text-gray-900">About Us</Link>
        </nav>

        <div className="relative flex items-center space-x-4">
          <div className="relative">
            <Search className="absolute left-2 top-1/2 transform -translate-y-1/2 text-gray-400" />
            <Input 
              className="pl-8" 
              placeholder="Search cars..." 
              value={searchTerm}
              onChange={handleSearch}
            />
            {searchTerm && searchResults.length > 0 && (
              <div className="absolute top-full left-0 w-full bg-white shadow-lg mt-2 rounded-lg max-h-60 overflow-y-auto">
                {loading ? (
                  <p className="p-2 text-center text-gray-500">Loading...</p>
                ) : (
                  searchResults.map((car) => (
                    <Link to={`/cars/${car._id}`} key={car._id} className="block p-2 hover:bg-gray-100">
                      <div className="flex items-center">
                        <img src={car.image} alt={car.model} className="w-12 h-8 object-cover mr-3" />
                        <div>
                          <h3 className="font-semibold text-sm">{car.model}</h3>
                          <p className="text-xs text-gray-500">{car.make}</p>
                        </div>
                      </div>
                    </Link>
                  ))
                )}
              </div>
            )}
          </div>

          {isAuthenticated ? (
            <Link to="/profile">
              <Button variant="ghost" size="icon">
                <User className="h-5 w-5" />
              </Button>
            </Link>
          ) : (
            <Link to="/login">
              <Button variant="ghost" size="icon">
                <User className="h-5 w-5" />
              </Button>
            </Link>
          )}
        </div>
      </div>
    </header>
  );
}
